import React, { useState } from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';
import { Plus, Trash2, ArrowRight, GripVertical } from 'lucide-react';

const Backlog = ({ backlogTasks, setBacklogTasks, priorities, addTaskToToday }) => {
  const [newTaskTitle, setNewTaskTitle] = useState('');

  const addTask = () => {
    if (newTaskTitle.trim()) {
      const newTask = {
        id: Date.now().toString(),
        title: newTaskTitle.trim(),
        priority: ''
      };
      setBacklogTasks(prevTasks => [...prevTasks, newTask]);
      setNewTaskTitle('');
    }
  };

  const deleteTask = (taskId) => {
    setBacklogTasks(prevTasks => prevTasks.filter(task => task.id !== taskId));
  };

  const scheduleTask = (task, priorityId) => {
    addTaskToToday(task, priorityId);
    deleteTask(task.id);
  };

  const onDragEnd = (result) => {
    const { destination, source } = result;

    if (!destination) return;

    setBacklogTasks(prevTasks => {
      const newTasks = prevTasks.reduce((acc, task, index) => {
        if (index === source.index) {
          // Skip this index as we're moving this task
          return acc;
        }
        if (index === destination.index) {
          // Insert the dragged task before the task at the destination index
          acc.push(prevTasks[source.index]);
          acc.push(task);
        } else {
          // For all other indices, just add the task
          acc.push(task);
        }
        return acc;
      }, []);

      // If the task was moved to the end, add it here
      if (destination.index === prevTasks.length) {
        newTasks.push(prevTasks[source.index]);
      }

      return newTasks;
    });
  };

  return (
    <div className="max-w-4xl mx-auto p-4">
      <h1 className="text-2xl font-semibold mb-6">Backlog</h1>

      <div className="mb-4 flex">
        <input
          type="text"
          value={newTaskTitle}
          onChange={(e) => setNewTaskTitle(e.target.value)}
          onKeyPress={(e) => e.key === 'Enter' && addTask()}
          placeholder="Add a new task to backlog"
          className="flex-grow p-2 border rounded-l"
        />
        <button onClick={addTask} className="bg-blue-500 text-white p-2 rounded-r">
          <Plus className="w-5 h-5" />
        </button>
      </div>

      <DragDropContext onDragEnd={onDragEnd}>
        <Droppable droppableId="backlog">
          {(provided) => (
            <div {...provided.droppableProps} ref={provided.innerRef}>
              {backlogTasks.map((task, index) => (
                <Draggable key={task.id} draggableId={task.id} index={index}>
                  {(provided, snapshot) => (
                    <div
                      ref={provided.innerRef}
                      {...provided.draggableProps}
                      className={`flex items-center bg-white p-3 mb-2 rounded shadow ${
                        snapshot.isDragging ? 'bg-gray-100' : ''
                      }`}
                    >
                      <div {...provided.dragHandleProps} className="mr-2">
                        <GripVertical className="text-gray-400" />
                      </div>
                      <span className="flex-grow">{task.title}</span>
                      <div className="flex items-center">
                        <select
                          onChange={(e) => scheduleTask(task, e.target.value)}
                          className="mr-2 p-1 border rounded"
                        >
                          <option value="">Schedule to...</option>
                          {priorities.map((priority) => (
                            <option key={priority.id} value={priority.id}>
                              {priority.title || `Priority ${priority.id}`}
                            </option>
                          ))}
                        </select>
                        <button
                          onClick={() => deleteTask(task.id)}
                          className="text-red-500 hover:text-red-700"
                        >
                          <Trash2 className="w-5 h-5" />
                        </button>
                      </div>
                    </div>
                  )}
                </Draggable>
              ))}
              {provided.placeholder}
            </div>
          )}
        </Droppable>
      </DragDropContext>
    </div>
  );
};

export default Backlog;
